import React, { useState, useRef } from "react";
import { Dialog } from "primereact/dialog";
import { Button } from "primereact/button";
import { InputText } from "primereact/inputtext";
import { Password } from "primereact/password";
import { Toast } from "primereact/toast";
import "../Css/RegistrarCliente.css";

const RegistroUsuarioModal = () => {
  const [visible, setVisible] = useState(false);
  const [formData, setFormData] = useState({
    cedula: "",
    nombre: "",
    primerApellido: "",
    segundoApellido: "",
    direccion: "",
    telefono: "",
    correoElectronico: "",
    contrasena: "",
  });

  const toast = useRef(null);

  const handleInputChange = (e) => {
    const { name, value } = e.target;
    setFormData({ ...formData, [name]: value });
  };

  const handleSubmit = () => {
    if (Object.values(formData).some((value) => value.trim() === "")) {
      toast.current.show({
        severity: "warn",
        summary: "Campos vacíos",
        detail: "Por favor, completa todos los campos",
        life: 3000,
      });
      return;
    }

    console.log("Datos enviados:", formData);

    setFormData({
      cedula: "",
      nombre: "",
      primerApellido: "",
      segundoApellido: "",
      direccion: "",
      telefono: "",
      correoElectronico: "",
      contrasena: "",
    });

    toast.current.show({
      severity: "success",
      summary: "Registro exitoso",
      detail: "El usuario se ha registrado correctamente",
      life: 3000,
    });

    setVisible(false);
  };

  const InputField = ({ id, label, type = "text", ...props }) => (
    <div className="form-field">
      <label htmlFor={id} className="form-label">
        {label}
      </label>
      {type === "password" ? (
        <Password
          id={id}
          toggleMask
          className="form-input"
          inputClassName="form-input"
          {...props}
        />
      ) : (
        <InputText
          id={id}
          type={type}
          className="form-input"
          {...props}
        />
      )}
    </div>
  );

  const renderFooter = () => {
    return (
      <div className="footer-buttons">
        <Button
          label="Cancelar"
          icon="pi pi-times"
          onClick={() => setVisible(false)}
          className="p-button-text"
        />
        <Button
          label="Registrar"
          icon="pi pi-check"
          onClick={handleSubmit}
          className="registro-button"
        />
      </div>
    );
  };

  return (
    <div className="registro-container">
      <Toast ref={toast} />
      <Button
        label="Registrar Usuario"
        icon="pi pi-user-plus"
        onClick={() => setVisible(true)}
        className="registro-button"
      />
      
      <Dialog
        header="Registro de Usuario"
        visible={visible}
        className="registro-dialog"
        onHide={() => setVisible(false)}
        footer={renderFooter()}
      >
        <div className="registro-content">
          <InputField
            id="cedula"
            name="cedula"
            label="Cédula"
            value={formData.cedula}
            onChange={handleInputChange}
          />
          <InputField
            id="nombre"
            name="nombre"
            label="Nombre"
            value={formData.nombre}
            onChange={handleInputChange}
          />
          <InputField
            id="primerApellido"
            name="primerApellido"
            label="Primer Apellido"
            value={formData.primerApellido}
            onChange={handleInputChange}
          />
          <InputField
            id="segundoApellido"
            name="segundoApellido"
            label="Segundo Apellido"
            value={formData.segundoApellido}
            onChange={handleInputChange}
          />
          <InputField
            id="direccion"
            name="direccion"
            label="Dirección"
            value={formData.direccion}
            onChange={handleInputChange}
          />
          <InputField
            id="telefono"
            name="telefono"
            label="Teléfono"
            value={formData.telefono}
            onChange={handleInputChange}
          />
          <InputField
            id="correoElectronico"
            name="correoElectronico"
            label="Correo Electrónico"
            type="email"
            value={formData.correoElectronico}
            onChange={handleInputChange}
          />
          <InputField
            id="contrasena"
            name="contrasena"
            label="Contraseña"
            type="password"
            value={formData.contrasena}
            onChange={handleInputChange}
          />
        </div>
      </Dialog>
    </div>
  );
};

export default RegistroUsuarioModal;
